import React from 'react'
import { List, Card } from 'antd'
export default function index () {
  const data = [
    {
      title: '货物成本'
    },
    {
      title: '采购成本'
    },
    {
      title: 'Title 3'
    },
    {
      title: 'Title 4'
    },
    {
      title: 'Title 5'
    },
    {
      title: 'Title 6'
    }
  ]
  return (
    <div className='bordered inventory-cost'>
      <h2>库存成本</h2>
      <List
        grid={{
          gutter: 16,
          xs: 1,
          sm: 2,
          md: 4,
          lg: 4,
          xl: 6,
          xxl: 3
        }}
        dataSource={data}
        renderItem={item => (
          <List.Item>
            <Card title={item.title}>Card content</Card>
          </List.Item>
        )}
      />
    </div>
  )
}
